import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 299.11, date: new Date(2021, 2, 28) },
    { title: "Bike Insurance", amount: 299.11, date: new Date(2021, 3, 28) },
    { title: "Flight Insurance", amount: 299.11, date: new Date(2021, 4, 28) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
